export function CloseIcon({ fill, classes = "" }) {
  return (
    <svg
      width="30"
      height="30"
      viewBox="0 0 24 24"
      className={classes}
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M17 7L7 17M7 7L17 17"
        stroke="currentColor"
        stroke-width="2"
        stroke-linecap="round"
        stroke-linejoin="round"
      />
    </svg>
  );
}
